}


class TodoList extends Component {
    render() {
        let {data} = this.props;
        return (
            <div>
                <StyledList>
                    {data.map(({label, id}) => {
                        return (
                            <StyledListItem done={state.done} key={id}>
                                {label}
                            </StyledListItem>
                        )
                    })}

                </StyledList>
            </div>
        )
    }
}

TodoList.propTypes = {data: PropTypes.any}

export default TodoList;
